select
-- v3.DIAG, v.MPACNAME, v2.HVIDNAME, v3.HMNAM

from V022 v
join V018 v2 on v.IDMPAC = v2.IDHVID
join V019 v3 on v3.HVID = v2.IDHVID
join rbCureMethod rcm
GROUP by v.MPACNAME, v3.DIAG


